import {View,Text} from 'react-native';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state={

        message: 'hello hi',
    }

  }
    render(){
      return(
        <View>
          <Text>{this.state.message}</Text>
          <Text>IU</Text>
        </View>
      )
    }
}
export default App;
